import React from 'react'

const VideoPlayer = () => {
    return (
        <div >
            <ReactPlayer 
            url="https://www.youtube.com/watch?v=ZdDEvLgxQDQ&t=1s"
            width="100%"
            height = "200%"
            controls = {true}
            />
            
        </div>
    )
}

export default VideoPlayer
